public container activeDetailRecords()
{
    WMSArrivalDetailTmp     wmsArrivalDetailTmpSelected;
    container               detailRecords;

    wmsArrivalDetailTmpSelected = wmsArrivalDetailTmp_ds.getFirst(true, false) ? wmsArrivalDetailTmp_ds.getFirst(true, false) as WMSArrivalDetailTmp : wmsArrivalDetailTmp_ds.cursor() as WMSArrivalDetailTmp;
    while (wmsArrivalDetailTmpSelected)
    {
        detailRecords += [[wmsArrivalDetailTmp.InventTransId, wmsArrivalDetailTmp.InProgress]];
        wmsArrivalDetailTmpSelected = wmsArrivalDetailTmp_ds.getNext() as WMSArrivalDetailTmp;
    }
    return detailRecords;
}

public container activeOverviewRecords()
{
    WMSArrivalOverviewTmp   wmsArrivalOverviewTmpSelected;
    container               overviewRecords;

    wmsArrivalOverviewTmpSelected = wmsArrivalOverviewTmp_ds.getFirst(true, false) ? wmsArrivalOverviewTmp_ds.getFirst(true, false) as WMSArrivalOverviewTmp : wmsArrivalOverviewTmp_ds.cursor() as WMSArrivalOverviewTmp;
    while (wmsArrivalOverviewTmpSelected)
    {
        overviewRecords += [[wmsArrivalOverviewTmpSelected.InventTransType,
                             wmsArrivalOverviewTmpSelected.InventTransRefId,
                             wmsArrivalOverviewTmpSelected.DateStatus,
                             wmsArrivalOverviewTmpSelected.InventSiteId,
                             wmsArrivalOverviewTmpSelected.InventLocationId]];
        wmsArrivalOverviewTmpSelected = wmsArrivalOverviewTmp_ds.getNext() as WMSArrivalOverviewTmp;
    }
    return overviewRecords;
}

NoYes canShowLinesJournals()
{
    if (wmsArrivalDetailTmp.RecId && wmsArrivalDetailTmp.InProgress)
    {
        return NoYes::Yes;
    }

    return NoYes::No;
}

NoYes canShowOverviewJournals()
{
    WMSArrivalOverviewTmp   wmsArrivalOverviewTmpSelected;

    wmsArrivalOverviewTmpSelected = wmsArrivalOverviewTmp_ds.getFirst(true, false) ? wmsArrivalOverviewTmp_ds.getFirst(true) as WMSArrivalOverviewTmp : wmsArrivalOverviewTmp_ds.cursor() as WMSArrivalOverviewTmp;
    while (wmsArrivalOverviewTmpSelected)
    {
        if (wmsArrivalOverviewTmpSelected.ReceiptStatus != WMSReceiptStatus::None)
        {
            return NoYes::Yes;
        }

        wmsArrivalOverviewTmpSelected = wmsArrivalOverviewTmp_ds.getNext() as WMSArrivalOverviewTmp;
    }

    return NoYes::No;
}

