public void enableControls()
{
    SalesLine salesLine;

    //control disposition code field
    if (wmsArrivalDetailTmp.InventTransType == InventTransType::Sales && wmsArrivalDetailTmp.DirectRegistration == NoYes::Yes)
    {
        salesLine = SalesLine::findInventTransId(wmsArrivalDetailTmp.InventTransId);
        wmsArrivalDetailTmp_ds.object(fieldNum(WMSArrivalDetailTmp, ReturnDispositionCodeId)).allowEdit(salesLine.SalesType == SalesType::ReturnItem);
    }
    else
    {
        wmsArrivalDetailTmp_ds.object(fieldNum(WMSArrivalDetailTmp, ReturnDispositionCodeId)).allowEdit(false);
    }

    //control quantity field - it should only be editable for direct receipts since journals will not be created
    wmsArrivalDetailTmp_ds.object(fieldNum(WMSArrivalDetailTmp, InventQty)).allowEdit(wmsArrivalDetailTmp.DirectRegistration == NoYes::Yes);
}

void fillTables()
{
    Weight      weight;
    Volume      volume;
    InventQty   qty;
    TimeHour24  arrivalTime;
    NoYes       volumeMissing;
    NoYes       weightMissing;
    NoYes       timeMissing;
    container   inProgressTotalsLocal;

    PdsCWInProgressQty cwQty;

    using (var activityContext = element.instrumentationLogger().wmsArrivalOverview().fillTables())
    {
        if (!initializationDone)
        {
            return;
        }

        inProgressTotalsLocal = WMSArrivalOverviewGeneration::generateFromForm(wmsArrivalOverviewTmp,
                                    wmsArrivalDetailTmp,
                                    wmsArrivalOverviewOptions.pack());

        if (conLen(inProgressTotalsLocal) < 8) // Display problem where container is corrupted
        {
            inProgressTotalsLocal = WMSArrivalOverviewGeneration::getInProgressTotals(wmsArrivalDetailTmp);
        }

        [weight, volume, qty, arrivalTime, volumeMissing, weightMissing, timeMissing, cwQty] = inProgressTotalsLocal;

        inProgressQtyTotal.realValue(qty);

        pdsCWInProgressQtyTotal.realValue(cwQty);

        inProgressVolumeTotal.realValue(volume);
        inProgressWeightTotal.realValue(weight);
        inProgressTimeTotal.text(element.time2strManyHours(arrivalTime));

        wmsArrivalOverviewTmp_ds.executeQuery();
        element.updateTotals();
    }
}

public void init()
{
    using (var activityContext = element.instrumentationLogger().wmsArrivalOverview().init('form'))
    {
        wmsArrivalOverviewOptions = WMSArrivalOverviewOptions::construct();

        super();

        imageListAppl   = new ImageListAppl_WMS();

        windowOutOfRange.imageList(imageListAppl.imageList());
        windowInProgress.imageList(imageListAppl.imageList());
        windowQuarantine.imageList(imageListAppl.imageList());

        WMSArrivalOverviewProfile::generateDefaultProfiles();

        xSysLastValue::getLast(this);
    }
}

public void run()
{
    super();

    element.setCaption();

    initializationDone = true;  // now we are done initializing and can fill tables if requested

    if (wmsArrivalOverviewOptions.parmUpdateOnStartup())
    {
        element.fillTables();
    }

    element.updateProgressShowing();
}

void setCaption()
{
    if (wmsArrivalOverviewOptions.parmInventSiteIdDock())
    {
        element.design().caption(strFmt("@SCM:ArrivalOverviewCaptionIncludingSiteDim",
                wmsArrivalOverviewOptions.parmInventSiteIdDock(),
                wmsArrivalOverviewOptions.parmInventLocationIdDock(),
                wmsArrivalOverviewOptions.parmWmsLocationIdDock(),
                wmsArrivalOverviewOptions.parmWmsJournalNameId()));
    }
    else
    {
        element.design().caption(strFmt("@SCM:ArrivalOverviewCaptionExcludingSiteDim",
                wmsArrivalOverviewOptions.parmInventLocationIdDock(),
                wmsArrivalOverviewOptions.parmWmsLocationIdDock(),
                wmsArrivalOverviewOptions.parmWmsJournalNameId()));
    }
}

/// <summary>
/// Controls the availability of the Transaction type and Return number fields on the Arrival query details fast tab.
/// </summary>
void setOptionFieldsAccess()
{
    boolean nonReturnFieldsClear =
        !wmsArrivalOverviewOptions.parmInclPurch()
        && !wmsArrivalOverviewOptions.parmInclProd()
        && !wmsArrivalOverviewOptions.parmInclQuarantine()
        && !wmsArrivalOverviewOptions.parmInclTransfer()
        && !wmsArrivalOverviewOptions.parmInclOther();

    boolean transFieldsAccess = !wmsArrivalOverviewOptions.parmInclReturn();

    inclPurchCtrl.enabled(transFieldsAccess);
    inclProdCtrl.enabled(transFieldsAccess);
    inclQuarantineCtrl.enabled(transFieldsAccess);
    inclTransferCtrl.enabled(transFieldsAccess);
    inclOtherCtrl.enabled(transFieldsAccess);
    includeConsignmentReplenishmentOrder.enabled(transFieldsAccess);
    inclReturnCtrl.enabled(nonReturnFieldsClear);
    editReturnItemNum.enabled(nonReturnFieldsClear);
}

