void updateProgressShowing(NoYes _clearSelections = NoYes::No)
{
    Query                   queryOverview = wmsArrivalOverviewTmp_q;
    FormDataSource          dataSourceOverview;
    QueryBuildRange         rangeOverview;

    Query                   queryDetail = wmsArrivalDetailTmp_q;
    FormDataSource          dataSourceDetail;
    QueryBuildRange         rangeDetail;
    QueryBuildRange         rangeDetailQty;

    using (var activityContext = element.instrumentationLogger().wmsArrivalOverview().updateProgressShowing())
    {
        if (_clearSelections)
        {
            WMSArrivalOverviewTmp::deselectAll(wmsArrivalOverviewTmp, wmsArrivalDetailTmp);
            element.updateTotals();
        }

        rangeOverview = SysQuery::findOrCreateRange(queryOverview.dataSourceNo(1), fieldNum(WMSArrivalOverviewTmp, ReceiptStatus));
        rangeDetail = SysQuery::findOrCreateRange(queryDetail.dataSourceNo(1), fieldNum(WMSArrivalDetailTmp, InProgress));
        rangeDetailQty = SysQuery::findOrCreateRange(queryDetail.dataSourceNo(1), fieldNum(WMSArrivalDetailTmp, InventQty));
        switch (wmsArrivalOverviewOptions.parmArrivalProgressSelection())
        {
            case WMSArrivalProgressSelection::All:
                rangeOverview.value(SysQuery::valueUnlimited());
                rangeDetail.value(SysQuery::valueUnlimited());
                rangeDetailQty.value(SysQuery::valueUnlimited());
                detailsGrid_Volume.visible(true);
                detailsGrid_Weight.visible(true);
                detailsGrid_ArrivalHandlingTime.visible(true);
                detailsGrid_InProgressVolume.visible(false);
                detailsGrid_InProgressWeight.visible(false);
                detailsGrid_InProgressArrivalHandlingTime.visible(false);
                break;
            case WMSArrivalProgressSelection::NotComplete:
                rangeOverview.value(SysQuery::valueNot(WMSReceiptStatus::Complete));
                rangeDetail.value(SysQuery::valueUnlimited());
                rangeDetailQty.value(SysQuery::valueNot(0));
                detailsGrid_Volume.visible(true);
                detailsGrid_Weight.visible(true);
                detailsGrid_ArrivalHandlingTime.visible(true);
                detailsGrid_InProgressVolume.visible(false);
                detailsGrid_InProgressWeight.visible(false);
                detailsGrid_InProgressArrivalHandlingTime.visible(false);
                break;
            case WMSArrivalProgressSelection::InProgress:
                rangeOverview.value(SysQuery::valueNot(WMSReceiptStatus::None));
                rangeDetail.value(queryValue(NoYes::Yes));
                rangeDetailQty.value(SysQuery::valueUnlimited());
                detailsGrid_Volume.visible(false);
                detailsGrid_Weight.visible(false);
                detailsGrid_ArrivalHandlingTime.visible(false);
                detailsGrid_InProgressVolume.visible(true);
                detailsGrid_InProgressWeight.visible(true);
                detailsGrid_InProgressArrivalHandlingTime.visible(true);
                break;
        }
        dataSourceOverview = FormDataUtil::getFormDataSource(wmsArrivalOverviewTmp);
        dataSourceOverview.query(queryOverview);

        dataSourceDetail = FormDataUtil::getFormDataSource(wmsArrivalDetailTmp);
        dataSourceDetail.query(queryDetail);

        wmsArrivalOverviewTmp_ds.executeQuery();
    }
}

void updateTotals()
{
    Weight                  weight;
    Volume                  volume;
    InventQty               qty;
    TimeHour24              arrivalTime;
    NoYes                   volumeMissing, weightMissing, timeMissing;

    PdsCWInventQty          cwQty;
    using (var activityContext = element.instrumentationLogger().wmsArrivalOverview().updateTotals())
    {
        [weight, volume, qty, arrivalTime, volumeMissing, weightMissing, timeMissing, cwQty] = WMSArrivalOverviewGeneration::selectedTotals(wmsArrivalDetailTmp);

        volumeTotal.realValue(volume);
        weightTotal.realValue(weight);
        qtyTotal.realValue(qty);

        pdsCWQtyTotal.realValue(cwQty);

        timeTotal.text(element.time2strManyHours(arrivalTime));

        startArrivalButton.enabled(qty != 0);
    }
}

public boolean validateLocations()
{
    boolean             ret                 = true;
    InventSiteId        inventSiteId        = inventSiteIdDockCtrl.text();
    InventLocationId    inventLocationId    = inventLocationIdDockCtrl.text();
    WMSLocationId       wmsLocationId       = wmsLocationIdDockCtrl.text();

    // Validate warehouse
    ret = InventLocation::checkExist(inventLocationId);
    if (ret && inventLocationId)
    {
        if (inventSiteId && InventLocation::find(inventLocationId).InventSiteId != inventSiteId)
        {
            ret = checkFailed (strFmt("@SYS104861", inventLocationId, inventSiteId));
        }
    }

    // Validate location
    if (ret && wmsLocationId)
    {
        if (!WMSLocation::exist(wmsLocationId, inventLocationId))
        {
            ret = checkFailed(strFmt("@SYS53781", wmsLocationId, inventLocationId));
        }
    }

    return ret;
}

