private container pack()
{
    packedOptions = wmsArrivalOverviewOptions.pack();
    return [#CurrentVersion, #CurrentList];
}

/// <summary>
/// Initializes the form with options from <c>SysLastValue</c>.
/// </summary>
/// <param name = "_packedClass"></param>
/// <returns></returns>
private boolean unpack(container _packedClass)
{
    Version                 version = RunBase::getVersion(_packedClass);
    container               packedList;

    switch (version)
    {
        case #CurrentVersion :
            [version, #CurrentList] = _packedClass;
            if (wmsArrivalOverviewOptions.unpack(packedOptions))
            {
                if (wmsArrivalOverviewOptions.parmProfileName())
                {
                    this.profileChanged();
                }
                else
                {
                    this.optionsChanged();
                }
            }
            else
            {
                return false;
            }
            break;

        default :
            return false;
    }

    return true;
}

