/// <summary>
///     Adds the 'View details' option to the context menu for number field.
/// </summary>
/// <remarks>
///     If the arrival record is a return order the jumpRef method of the RMA number is used.
/// </remarks>
public void jumpRef()
{
    if (wmsArrivalOverviewTmp.InventTransType == InventTransType::Sales && wmsArrivalOverviewTmp.ReturnItemNum)
    {
        wmsArrivalOverviewTmp_ds.object(fieldNum(WMSArrivalOverviewTmp, ReturnItemNum)).jumpRef();
    }
    else if (wmsArrivalOverviewTmp.InventTransType == InventTransType::InventTransfer
        && InventJournalTableJumpRefFromWMSArrivalOverviewFlight::instance().isEnabled())
    {
        element.jumpRefInventTransfer(wmsArrivalOverviewTmp.InventTransRefId);
    }
    else
    {
        super();
    }
}

