public void selectedFieldModified(boolean _modifySelect)
{
    WMSArrivalOverviewTmp wmsArrivalOverviewTmpLocal;
    WMSArrivalDetailTmp wmsArrivalDetailTmpLocal;

    using (var activityContext = element.instrumentationLogger().wmsArrivalOverview().modified())
    {
        if (_modifySelect)
        {
            wmsArrivalDetailTmpLocal.setTmpData(wmsArrivalDetailTmp);
            // must selected field on overview be changed?
            select firstonly wmsArrivalDetailTmpLocal
            where wmsArrivalDetailTmpLocal.InventTransType == wmsArrivalDetailTmp.InventTransType
                && wmsArrivalDetailTmpLocal.InventTransRefId == wmsArrivalDetailTmp.InventTransRefId
                && wmsArrivalDetailTmpLocal.DateStatus == wmsArrivalDetailTmp.DateStatus
                && wmsArrivalDetailTmpLocal.InventLocationId == wmsArrivalDetailTmp.InventLocationId
                && wmsArrivalDetailTmpLocal.RecId != wmsArrivalDetailTmp.RecId
                && wmsArrivalDetailTmpLocal.InventQty > 0
                && wmsArrivalDetailTmpLocal.Selected != wmsArrivalDetailTmp.Selected;

            if (!wmsArrivalDetailTmpLocal.RecId)
            {
                wmsArrivalOverviewTmpLocal.setTmpData(wmsArrivalOverviewTmp);
                ttsbegin;
                select firstonly forupdate wmsArrivalOverviewTmpLocal
                where wmsArrivalOverviewTmpLocal.InventTransType == wmsArrivalDetailTmp.InventTransType
                    && wmsArrivalOverviewTmpLocal.InventTransRefId == wmsArrivalDetailTmp.InventTransRefId
                    && wmsArrivalOverviewTmpLocal.DateStatus == wmsArrivalDetailTmp.DateStatus
                    && wmsArrivalOverviewTmpLocal.InventLocationId == wmsArrivalDetailTmp.InventLocationId
                    && wmsArrivalOverviewTmpLocal.Selected != wmsArrivalDetailTmp.Selected;

                if (wmsArrivalOverviewTmpLocal.RecId)
                {
                    wmsArrivalOverviewTmpLocal.Selected = wmsArrivalDetailTmp.Selected;
                    wmsArrivalOverviewTmpLocal.write();
                    wmsArrivalOverviewTmp_ds.reread();
                    wmsArrivalOverviewTmp_ds.active();
                }
                ttscommit;
            }
        }

        element.updateTotals();
    }
}

public void modified()
{
    InventQty returnLineQty;

    if (wmsArrivalDetailTmp.InventTransType == InventTransType::Sales)
    {
        //Find the original return qty on the return order line
        returnLineQty = abs(SalesLine::findInventTransId(wmsArrivalDetailTmp.InventTransId).ExpectedRetQty);

        if (returnLineQty > 0 && wmsArrivalDetailTmp.InventQty < returnLineQty)
        {
            if (Box::okCancel("@SYS323245", DialogButton::Ok) == DialogButton::Cancel)
            {
                //Revert the quantity to the original return quantity.
                wmsArrivalDetailTmp.InventQty = returnLineQty;
            }
        }
    }
}

