void clicked()
{
    using (var activityContext = element.instrumentationLogger().wmsArrivalOverview().clicked('StartArrivalButton'))
    {
    // Save values from selected record as they are needed to re-select the record.
    WMSArrivalOverviewTmp selectedRecord = WMSArrivalOverviewTmp_ds.cursor();
    DateStatus dateStatus               = selectedRecord.DateStatus;
    InventTransType inventTransType     = selectedRecord.InventTransType;
    InventTransRefId inventTransRefId   = selectedRecord.InventTransRefId;
    InventSiteId inventSiteId           = selectedRecord.InventSiteId;
    InventLocationId inventLocationId   = selectedRecord.InventLocationId;

    super();

    if (FeatureStateProvider::IsFeatureEnabled(KittingFeature::instance()) && KittingWMSHelper::WMSArrivalOverview_skipStartArrival(WMSArrivalDetailTmp))
    {
        element.fillTables();
        return;
    }

    WMSArrivalStart::startArrival(
            wmsArrivalDetailTmp,
            wmsArrivalOverviewOptions.parmWmsJournalNameId(),
            wmsArrivalOverviewOptions.parmInventLocationIdDock(),
            wmsArrivalOverviewOptions.parmInventSiteIdDock(),
            wmsArrivalOverviewOptions.parmWmsLocationIdDock());

    element.fillTables();

    // The selectedRecord variable no longer has reference to the original record. Need to re-select to find the original record and set focus to it
    WMSArrivalOverviewTmp tmpTable;
    tmpTable.setTmpData(wmsArrivalOverviewTmp);

    WMSArrivalOverviewTmp originalRecord = WMSArrivalOverviewTmp::find(tmpTable, dateStatus, inventTransType, inventTransRefId, inventSiteId, inventLocationId);

    if (originalRecord.RecId)
    {
        if (WMSArrivalOverviewReceiptGridCursorRetainFlight::instance().isEnabled())
        {
            //BP Deviation documented
            wmsArrivalOverviewTmp_ds.findRecord(originalRecord);
        }
        else 
        {
            element.args().lookupRecord(originalRecord);
            wmsArrivalOverviewTmp_ds.research(false);
        }
    }
}
}

void clicked()
{
    super();

    WMSArrivalOverviewTmp::selectAll(wmsArrivalOverviewTmp, wmsArrivalDetailTmp);
    wmsArrivalOverviewTmp_ds.research();
    element.updateTotals();
    element.showSelected();
}

void clicked()
{
    super();

    WMSArrivalOverviewTmp   wMSArrivalOverviewTmpSelected;

    QueryRun qr = new QueryRun(WMSArrivalOverviewTmp_ds.queryRun().query());
    qr.setRecord(wmsArrivalOverviewTmp);

    while(qr.next())
    {
        wMSArrivalOverviewTmpSelected = qr.get(tableNum(WMSArrivalOverviewTmp));
        wMSArrivalOverviewTmpSelected.Selected = NoYes::Yes;
        wMSArrivalOverviewTmpSelected.update();

        WMSArrivalDetailTmp::updateSelected(wmsArrivalDetailTmp,
                                            wMSArrivalOverviewTmpSelected.Selected,
                                            wMSArrivalOverviewTmpSelected.InventTransType,
                                            wMSArrivalOverviewTmpSelected.InventTransRefId,
                                            wMSArrivalOverviewTmpSelected.DateStatus,
                                            wMSArrivalOverviewTmpSelected.InventSiteId,
                                            wMSArrivalOverviewTmpSelected.InventLocationId);
    }

    wmsArrivalOverviewTmp_ds.research();
    element.updateTotals();
    element.showSelected();
}

